import client from '../config';
import PostList from '../components/postList'
const Blog = (props) => {
    return (
        <div>
            {props.items.map(item => (
                <PostList item={item} key={item.sys.id} />
            ))}
        </div>
    )
}

Blog.getInitialProps = async () => {
    const entries = await client.getEntries('blogPost');
    return entries
}

export default Blog;
